const { Card, CardHeader } = require("@material-ui/core")

const Cashiers = ()=>{
    return(
        <Card>
            <CardHeader
             title={'Cashiers'}
             color={'textSecondary'}
            />
        </Card>
    )
}
export default Cashiers
